import 'bootstrap/dist/css/bootstrap.min.css';
import * as ReactBootStrap from 'react-bootstrap';
import github from '../Images/icons/github.svg';
import instagram from '../Images/icons/instagram.svg';
import linkedin from '../Images/icons/linkedin.svg';

function FooterComp() {
    return (
      <div className="App">

        <ReactBootStrap.Navbar expand="lg" variant="light" bg="light" sticky="bottom">
          <ReactBootStrap.Container>
            <ReactBootStrap.Navbar.Brand href="#">Yohan Arejouane</ReactBootStrap.Navbar.Brand>
            <div style={{ display : 'inline' }}>
            <ReactBootStrap.Nav.Link><img id="icons" src={github} alt="Github Logo" /></ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link><img id="icons" src={linkedin} alt="LinkedIn Logo" /> </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link><img id="icons" src={instagram} alt="Instagram Logo" /> </ReactBootStrap.Nav.Link>
            </div>
          </ReactBootStrap.Container>
        </ReactBootStrap.Navbar>
      </div>
    );
  }

  export default FooterComp;
